import React from "react";
import FormFieldText from "../text-input/form field text";
import "./Checkbox-input.css"
import {useForm} from "react-hook-form";


function CheckboxInputRow ({title, hourAmount, register}){

    return (
        <>


        <label className="container col1">
            {title}
            <input type="checkbox"
                  />
            <span className="checkmark"/>

        </label>
        <div className="col2">
            <FormFieldText
            id={title}
            register={register}/>
        </div>
        <div className="col3">
            <FormFieldText
                register={register}/>
        </div>
        <p className="col4">{hourAmount}</p>
        </>
    )
}


export default CheckboxInputRow
